        uint256 feeGrowthInside1Last;
        /// @dev computed amount of token0 owed to the position as of the last mint/burn/collect
        uint128 feeOwed0;
        /// @dev computed amount of token1 owed to the position as of the last mint/burn/collect
        uint128 feeOwed1;
